insert  into `comments`(`id`,`comment`,`sender_id`,`date`,`time`) values (115,' @jnl6 I meant team manager and \'Just\'. ',8,'2018-07-10','13:24:05'),(116,'Ok.',8,'2018-07-10','13:24:43'),(1,'Use case 10: Cash only STC.\nThe goal of the cash only STC is to pool trading capital of a group of traders together in order to multiply their combined purchasing power',9,'2018-05-03','13:45:43'),(2,'Use case 12:  Combined cash and warrants  STC: This model offers the option of both cash and warrants to producers by syndicated traders.',9,'2018-05-03','14:44:05'),(3,'With the STC, we are able to offer buy-all services to producers',9,'2018-05-03','16:00:16'),(4,'read and completed. New facts discovered.\nKnowlege broadened.',8,'2018-05-03','19:12:39'),(5,'Reading completed\n',8,'2018-05-04','13:10:39'),(6,'The overview of the large picture for the pilot phase has 5 subtopics. component of the pilot phase was one of the subtopics   ',10,'2018-05-04','13:56:55'),(7,'Under the components we have up to 17 components. Foundation Boost was one. we I did learn to was that FB was just one part of the reflation window, earned reflation window been the other part  ',10,'2018-05-04','14:00:37'),(8,'In FB you list/register goods, services or money; of anything of useful follow you can keep on bring to the market every day, week, month or years.',10,'2018-05-04','14:03:29'),(9,'4.6 Agents: I think this part of the warrants 2 way payment option answers the question of who will carry out our value propositions.\nMy first thoughts at the initial stage bordered mostly on \'who will do all these?\'\nThere are two classes of agents of the wealth market. They are:\n1. Franchises\n2. Other agents.\nThe Franchises: These include:\nDevex\nValuehouse\nFranco\nOnlender\nFEPCO\nPOT\nWM Escrow\nSyndicated traders\n\nOther agents include:\nMonetisers\nProject managers\nBuying and selling agents\n',9,'2018-05-04','14:05:48'),(10,'The value of what you listed on the market must be minimum of N3OO, OOO or 1% of your annual sales. The maximum value of what you can list on the market is N3O,OOO,OOO or 1O% of your annual sales. Once your listed goods, services or money is verified you are given the formal right to have your cash tripled.   ',10,'2018-05-04','14:08:13'),(11,'Reflation which is the increase in your purchasing power is only needed to buy up the inventories in the market at consumer price. whereas primary warrants had been issued only at producer price. ',10,'2018-05-04','14:11:21'),(12,'Also subscriber acquires no right under the FB to get cash at par. Rather in the liquidation scenario he cashes his remaining warrants at the on going price against cash.     ',10,'2018-05-04','14:17:47'),(13,'Mr Alex told me SeMPLe simply means sell more and pay less. ',10,'2018-05-04','14:59:13'),(14,'There are three ways of SeMPLe\n1] You sell your goods to the MOE but the goods will remain in your custody, this is called Third party custody.\n2] you sell the your goods to the MOE and the MOE takes the goods from you,  it is called MOE custody\n3] You can list your goods with the MOE ',10,'2018-05-04','15:03:15'),(15,'SeMPLe for Retailer\nThe retailer will list 1o% of his inventories and then the WM pays him up front, his collection account is debited while his payment account is credited. Every subscriber has a trading account which contains the collection account and the payment account.  ',10,'2018-05-04','15:06:44'),(16,'For those who list their goods with the MOE they get no reflation right but those who sells to the MOE gets.\nBut what percentage do they get? ',10,'2018-05-04','15:08:17'),(17,'From the little there is to read in the manifesto, I think the manifesto was to financed the building of private houses because the financial service sector has not been doing that well. It was even stated that less than 5% of the privately owned houses was financed by the financial service sector and that people build houses from their salaries, income and personal savings. There is no way their salaries, income and personal savings can build a house at once, so they result in buying cements, trailer of sand, building blocks....and the likes as the money flows in.          ',10,'2018-05-07','14:53:02'),(18,'FBRR. What\'s new?\n(a) Universal Purchasing-power Expansion Programme (UPEP)\n(b) Circular (Supplier-Driven) UPEP\nUPEP for Buyers in brief:\ni. N20k worth of additional purchasing power put into the hands of buyers.\nii. They bring cash of N5k and get N25k warrants instantly.\niii.N5k is credited into their \"offline market account.\"\niv. The N5k stays with the MOE.\nv. Target of 10 million natural persons.\nvi. First tranche will run for 3 months.\nRisks assessment were carried out.\nMitigants:\ni. SePMLe: SeMPLe has to be in place before UPEP for buyers is rolled out.\nii. UPEP for sellers: This will precede or start with UPEP for buyers.',9,'2018-05-07','17:38:11'),(19,'Redoing the concepts of of warrant retirement in the case of constructing a road to a completely built up setting, High cost infrastructure and Social Infrastructure .',8,'2018-05-07','17:41:04'),(20,'UPEP for sellers cont\'d:\ni. Sellers must list their goods and/or services.\nii. The listing is a contractual agreement between the WM and the seller.\niii. The seller is given reflation rights \niv. The seller brings cash to avail of his reflation rights .\n\n\n',9,'2018-05-07','18:37:10'),(21,'I have spent time with Akachi on her video editing learning process. We reviewed what Ini and Victor did and how much of their work were documented and inherited. She is to review the grid of effects and sample videos to see how far she has come in harvesting the in-house knowledge base we have invested in.',11,'2018-05-17','14:01:02'),(22,'I also spent time with Mayowa. I gave him the two introductory documents to read and understand. The Universal Monetisation and To the Foundation Insurers document. After about 2 hours he came back and I asked him a few questions from the Universal Monetisation document...I saw that his understanding was still quite basic. So I told him to go back and read again and master it fully.',11,'2018-05-17','14:14:57'),(23,'General Tasks haven\'t been implemented yet.',11,'2018-05-17','14:16:50'),(24,'No general tasks yet.',11,'2018-05-17','14:18:46'),(25,'No warning when deleting a task. I mistakenly deleted a task. I wanted to delete the comment. I saw the \"X\" on top of the comment text box and pressed it hoping to delete the comment only to see that the whole task was deleted without any warning.',11,'2018-05-17','14:20:58'),(26,'The left panel can\'t be scrolled. ',11,'2018-05-17','14:23:03'),(27,'Reading and documenting my view and understanding on Universal Monetisation and poverty eradication program.',13,'2018-05-17','14:25:25'),(28,'The problem here is that if a supplier is petrol at per to the wealthmarket say 100 with a profit of 5%, he will need 95 cash restock but if he discount his warrants he can only have 67cash. so how will he go about it.\n There are two ways to go about this we either make the sale of petrol reflation accruing transaction or through par cash right.',10,'2018-05-22','12:16:54'),(29,'we make the sale of petrol reflation accruing at a rate the can be computed by adding the current rate at the discount window(20%) plus him profit margin (5%). 25% of his supplier worth 100, he has a RR of 25 that he can avail by bringing cash of 2.5. After selling his product he gets warrants of 100, he would use his profit (5warrants out of the total sale) to trade on the WM. he now has 95warrants + his RR of 25warrants=120warrants. he can take them to the discount window to discount them, he will get 80% of the 120=96cash. this means he would have monetise his profit, gain his full profit of 5 and have enough to restock his product. Cost 100worth of petrol + 2.5 cash to avail his RR= 102.5. Returns 96cash + 5warrants profit= 101. this means he will be getting 102.5-101=1.5 less on aggregate but the advantage is that his gained more than what he loss and he will sell more/faster in the WM than in the Open market              ',10,'2018-05-22','12:32:05'),(30,'For the par cash right he brings cash of at least 95 at par to earn par cashing right. makes his purchases with the warrants he got at par on the WM. he sells his petrol value 100, uses the profit 5 to buy whatever he wants in the WM. and he can exchange the 95warrants at par for cash at the discount window. This method is less incentive to the seller petrol.       ',10,'2018-05-22','12:36:55'),(31,'The objective of this Use case is to empower service providers by paying them 100% upfront for the value that they sell to the WM under an agreement.',10,'2018-05-22','12:56:51'),(32,'There are a lot of process options but in summary taking a transport company called BRT for example if it sells a seat in it bus for a 10km distance for N100 the WM can buy like 1000 seats from them=1000k and issues the company a monetisation right which them can avail buy bringing say 5k. \nwhen the MR is avail her collection account is overdrawn by 100k and her payment account is credited by 120k, 5k in warrants is taken has charges by the MOE. when the services is sold 120k enters into her collection account and the OD of 100k is wiped off (only 100k warrants is retired) the 20k is backed by cash 5k        ',10,'2018-05-22','15:36:50'),(33,'Haven\'t bought the transport service, the WM issues transport tickets as payment for those service. the transport ticket is accepted as payment by the company for those services bought by the WM. the transport ticket can by bought with warrants. who so ever presents the transport ticket to the transport company is deemed to have purchase the service and he/she is attended to.    ',10,'2018-05-22','15:45:32'),(34,'Many sellers has unsold inventories on the basis that consumers has low purchasing power and many local producers has closed up, those that are still thriving to start in existence are draw back by lack of electricity, multiple taxation, raising cost of production, low consumer\'s purchasing power and cheaper imports.\nThe goal of this Use case 11 was to organizs a program where local producers can monetise their products regardless of the cost  ',10,'2018-05-25','12:25:23'),(35,'This is done through the STC, STC stands for Syndication Trading Chain it refers to syndicated trader. The syndicated traders registers with the WM and enters a contract with the MOE to buy from pre-approved producers under the programand sale on it behalf since the MOE is an entity, in the contract the STC are given 5-folds reflation to any cash they brings as collateral, this implies that the STC can now buy 5times their original cash.      ',10,'2018-05-25','12:34:13'),(36,'The STC\'s structure is made up of four levels. \nlevel 1 traders: Distributor- buy from the pre approved producer and pay him.\nLevel 2 trader: Producer side wholesaler- he buys from the distributor and sales to the consumer side wholesaler.\nLevel 3 trader: Consumer side wholesaler- buys from the level 2 trader and sells to level 4 trader.\n Level trader: retailer buys for the level 3; consumer side wholesaler and sells to the final consumer.\nThey all add a mark up of 10% before selling to the next level trader ones the goods gets to them. the MOE take 0.05% as Commission-On-Credit (COC) from each trader\'s market account.   ',10,'2018-05-25','12:43:44'),(37,'Imported goods can also be bought from producer depending on the MOE discretion. The WM in it core objective was to promote local producers so buying and selling imported goods would not have stopped because the WM have a way of reducing production    lost of local producers be supping their input and a 50% reduced cost or subsidy can be given to the consumer by selling targeted warrants that can only be used to purchase the local producer outputs at a significant discount.      ',10,'2018-05-25','12:51:33'),(38,'With the instrument of ManSAR the MOE makes it mandatory to all beneficiaries of reflation to allocate some of their purchasing power accretion to highly beneficial things they would ordinary glossed over like investment in road construction, health, street lights,...etc. General whats are referred to as public goods.     ',10,'2018-05-25','14:42:10'),(39,'ManSAr will be applicable to reflation gotten at Earned Reflation Window, it is not applicable to UPEP and Discount window.',10,'2018-05-25','14:46:16'),(40,'The MOE sets up ManSAR account for each registered member. The MOE set a default matrix for allocating warrants into the ManSAR account.\nMembers are made aware fo the workings of ManSAR and how they can benefit from it.   ',10,'2018-05-25','15:23:52'),(41,'The MOE determines the sectoral account from which purchasing power would be targeted. For now it goes with the acronym DVICMS\nDirect\nInfrastructure Vote\nInsurance\nCharges\nManager\'s Discretion\nSERAFS ',10,'2018-05-25','15:27:17'),(42,'With the STC we are able to offer the buy-all service to producers, this is because of the five-fold boost given in the case of Warrant only STC and three-fold boost given in the case of Cash only STC. ',10,'2018-06-04','13:39:06'),(43,'The STC can be operated using cash through Bank Account and using market warrant through Market Account.    ',10,'2018-06-04','13:40:52'),(44,'The combined cash and warrant STC is a model where syndicated trader can combine both cash and warrant to make payment to the producer and between each other.  ',10,'2018-06-04','13:43:08'),(45,'Under this model the dealer offers to buy 60% of what the producer offers for sale with market warrant and the remaining 40% with cash.  ',10,'2018-06-04','13:45:15'),(46,'Downloaded AVS software on avs4you.com.\npresently working on the tutorial on how to use it.',13,'2018-06-04','15:24:46'),(47,'Team manager. With Stephen and Abiola ...',14,'2018-06-04','16:57:52'),(48,'Team manager. With Stephen and Abiola ...',14,'2018-06-04','16:57:52'),(49,'Joe, Akachi, Favour and Seun just joined the meeting',11,'2018-06-04','17:16:48'),(50,'Seun. 4 use cases. 9 to 12.\nASSIGNMENT\nOne only has a diagram. Choose any of the other 3 and do a diagram for it that can enter our p doc',14,'2018-06-04','17:20:29'),(51,'Favour.\nMuch work was on his pc. Not moved to his NDF work folder. About 10 files.\nStarted doing headers / TOC for his recent transcriptions. Like 3.\nAbout 4 pending audios bw 2017 and 2018.\nAbiola has approved them for transcribing.\n\nROLE ASSIGNMENT\nJoe henceforth begins process compliance audit for the DOC team. Everybody and everything, including those handled by Akachi. \nHe should produce a checklist that everybody will check off their own compliance by themselves. He is only responsible for checking and reporting exceptions.\nEach person will have a copy of that checklist.\n\n',14,'2018-06-04','17:31:20'),(52,'Akachi\nVideo. Bible in 3 minutes.\nEffect. Bible flipping of pages. \nDoes Ini\'s Prezi only do pan and zoom and nothing else?\n\nAnimatron for lion and snake animation ...\nDont go overboard about quality of drawing. Just demonstrate the animation.\nShow us today.',14,'2018-06-04','17:43:50'),(53,'Joe\nAkachi has been doing most of her work directly into the book app.\nJoe did same for Favour\'s work.\n\nWill do indexing after the headers ...',14,'2018-06-04','17:45:31'),(54,'Why is our static ip bumping out?\nThe NigDevFoundation modem is the old MTN. Perhaps it owns our static ip because the Netgear broadcasts only. We should adopt its own ip and reset everything ....\nHow does this affect the fact that even the NDFWLAN is supposed to bring in internet for broadcasting ... We didn\'t let that happen because that would lead to hugging too much bandwidth ....\nSome troubleshooting reqd a la Stephen... At his own time ... Maybe Friday night ...\nFirst check many of our assumptions ...\n',14,'2018-06-04','20:20:10'),(55,'Other attendees:\nSeun\nAlex\nMayowa\nEmma',11,'2018-06-05','13:33:27'),(56,'The target I want to achieve is to be able to animate drawn objects (drawn by hand and scanned to my PC), using CrazyTalk Animator 3, a video editing software.',7,'2018-06-06','10:22:27'),(57,'I forgot to click resume after my bathroom break, i have cut my necessary already, i\'m completely finished.',7,'2018-06-06','12:27:46'),(58,'Did half of the first branch; The Overview. Will continue tomorrow       ',10,'2018-06-06','16:33:23'),(59,'I cannot do this due to no internet.',7,'2018-06-07','11:29:42'),(60,'I have completed reviewing and re-tagging UC 09 - Producer Subsidy.\n',11,'2018-06-07','11:34:57'),(61,'Start from branch 4 tomorrow; straight to financial.   ',10,'2018-06-07','18:11:49'),(62,'I\'ve reached item 10 of 17 in \"Components of the Pilot Phase\". Today I was able to go through items 7 to 10. I searched and looked for where some Todos and documentation were and tried to insert and/or link them inside the mindmap.',11,'2018-06-07','19:20:43'),(63,'Done with straight to financials ',10,'2018-06-08','16:00:28'),(64,'I have reached almost 50% completion of going through the Warrants 2 way and updating it.\n',11,'2018-06-08','18:23:43'),(65,'There are three basic function of the FEPCO;\n1. Procure equipment for the benefits of local manufacturers\n2. Help in the manufacturing of equipment locally\n3. Procure/import technical know-how needed for the actualisation of the CoNPro Budget  ',10,'2018-06-11','13:16:56'),(66,'The FEPCO is able to procure equipment by using the output of the Specially Designated for Export production to import equipment and technology from the best all over the world. ',10,'2018-06-11','13:21:22'),(67,'The FEPCO pays for the outputs of SDE with warrants and sells it to other countries. FEPCO then use the proceeds to import the equipment needed from such countries. It was noted that FEPCO will mostly engage in reciprocal trade; FEPCO will typically buys from the countries it imported to. The FEPCO like any other business adds mark-up to the equipment procured and sells/lease it to local manufacturers who pays in warrants thereby retiring the primary warrants used to purchase SDE\'s products.      ',10,'2018-06-11','13:27:56'),(68,'FEPCO helps in the manufacturer of local equipment by ensuring captivating market for local equipment. The Franco does the investment FEPCO guarantees Franco market for the equipment.   ',10,'2018-06-11','13:32:27'),(69,'FEPCO helps in the manufacturer of local equipment by ensuring captivating market for local equipment. The Franco does the investment FEPCO guarantees Franco market for the equipment.   ',10,'2018-06-11','13:32:27'),(70,'FEPCO helps in the manufacturer of local equipment by ensuring captivating market for local equipment. The Franco does the investment FEPCO guarantees Franco market for the equipment.   ',10,'2018-06-11','13:32:27'),(71,'FEPCO helps in the manufacturer of local equipment by ensuring captivating market for local equipment. The Franco does the investment FEPCO guarantees Franco market for the equipment.   ',10,'2018-06-11','13:32:28'),(72,'By virtue of being an issuer of primary warrants and the sole receiving agent of equipment the FEPCO to play theses roles',10,'2018-06-11','13:35:07'),(73,'I spent over 1 hour with Emma and KO',11,'2018-06-11','14:23:54'),(74,'New insight given by Mr Abiola; UPEP can be renewed, it can be a continuous process. It is only logical to say sellers would moved to SeMPle after UPEP for sellers because of the high reflation given in UPEP for sellers.        ',10,'2018-06-11','14:33:03'),(75,'UPEP for sellers must come before UPEP for buyers, supply must precede an expansion in demand. Sellers might be advice to move to SeMPle after UPEP for sellers, it is still tentative.  ',10,'2018-06-11','14:37:05'),(76,'Under UPEP sellers will list 10% of their stock on the WM website, after meeting this requirement they will move to SeMPle where they can bring any amount of goods the desire.  ',10,'2018-06-11','14:39:14'),(77,'UPEP for sellers/SeMPle depends on the wealth market, Can both SeMPle and UPEP be run simultaneously?, Should UPEP for sellers be allowed to run continuously?....all these questions depends on the works better for wealth market     ',10,'2018-06-11','14:43:42'),(78,'In my opinion I believe UPEP for sellers should precede SeMPle, it should be allowed to run for say 3months and fter the 3months all sellers must move to SeMPLe. The Reflation Right received by by different sellers under UPEP will be to much if it is allowed to continue indefinitely. UPEP for sellers should be used as a tool to get sellers to subscribe into the WM and SeMPle is the real thing. UPEP should be a first timer stuff.       ',10,'2018-06-11','14:49:58'),(79,'UPEP for salary earners and UPEP for unemployed is said to exist. Can\'t we put them together with UPEP for buyers? ',10,'2018-06-11','14:54:03'),(80,'Typically we can say Reflation implies cost reduction or addition in purchasing power. ',10,'2018-06-11','14:57:54'),(81,'*Basically I meant',10,'2018-06-11','14:59:35'),(82,'In order to encourage the supply of goods and services to the wealth market, the MOE reward those who subscribe either goods or service at par on the WM with Reflation Right.   ',10,'2018-06-11','15:55:29'),(83,'There are two windows where Reflation can be earn;\n1. Earned Reflation Window\n2. Universal Purchasing-power \n    Expansion Programme window  ',10,'2018-06-11','15:59:09'),(84,'Error in my typo. It cannot be edited.',7,'2018-06-11','16:08:28'),(85,'The MOE announce and open UPEP which is usually three months, the MOE states the condition to be met; list 10% of your stock, members who meets the condition are given UPEP reflation right. UPEP reflation right are availed at their respective GDP       ',10,'2018-06-11','16:16:37'),(86,'Close to 70% of Nigerians are living below poverty line, so they don not have access to any form of credit loan from banks because they do not have collateral.  ',10,'2018-06-12','13:02:12'),(87,'To kick start any business in Nigeria a significant initial fund is needed and people living below poverty line would not be able to come up with such fund ',10,'2018-06-12','13:05:22'),(88,'It is against this backdrop that the WM introduced a business model called Capital in Kind. The capital in kind is aimed  at starting business that would have otherwise not started due to money, provided all the vital components like land, equipment and capital goods are in place',10,'2018-06-12','13:11:56'),(89,'The first stage is the submission and collation stage \n\nSubscribers are obliged to submit their business proposal to the WM online or to any valuehouse close to them, prior to the submission of the proposals there is an agreement in written form by the proposal owner to the WM that allows the WM opens the proposal in the absence of the owner. The valuehouse collates the proposals into a data bank. where only the Franco have access to in their search finding people with similar business interest.       ',10,'2018-06-12','13:52:54'),(90,'On the basis of the permission granted the Franco open their proposals and mine information from the data bank and finds people with similar business interest. ',10,'2018-06-12','13:55:07'),(91,'The franco invites the involved parties to a meeting. A business plan is drawn and agreement is reached as to the shareholding structure  ',10,'2018-06-12','13:57:54'),(92,'At the meeting a new business is birthed and a name is jointly agreed by all parties involved. According to the weight of their inputs all parties becomes shareholders.   ',10,'2018-06-12','14:00:26'),(93,'The Franco plays the role of a trusted party, management expert, shareholder and co-investor',10,'2018-06-12','14:02:16'),(94,'I went to look at our original documentation / transcription of the Debt Clearing and Settlement service of the WM. I ended up trying to get a hang of a few things on WRITE app. I documented my experiences in the notepad I use to keep track of my experience of the WRITE app.',11,'2018-06-12','14:13:25'),(95,'Background\nWe contend that the government is the greatest enemy to the development of Nigeria and in this regard we want to document some of the ways through which it has done this.\n\nThis should be properly captured in our manifesto.\n\nSome of the ways that the government itself has undermined Nigeria’s developmental efforts include the following:\n1.	The fact that there is no petro-chemical industry in Nigeria because there is no value chain in the petrochemical industry.\n2.	That we can’t maintain coal dependent power plants in spite of the fact that there is an abundant of coal deposits in Nigeria like in Enugu and Kogi among other places. The US has about 30% of her power plants running on coal. Germany has dismantled her nuclear plants and gone back to coal-powered plants. And lastly, China has a lot of power generating plants that are based on coal.\n3.	Ajokuta steel plant has continued to be a money guzzler; an endless pit for draining the national treasury.\n4.	We ran our refineries aground and now spent fortunes importing refined products.\n5.	We built independent power projects very far from areas where we have gas. And in any case the plants were built before we realized that we have to also construct pipelines from the Niger delta to take gas to those places. \n6.	Nigeria’s military carried out a study on existing steel plants in Nigeria in the recent past. Their discovery was that there are many steel plants that roll out steel pellets using pieces of iron rods and pipes supplied by cart pushers. Such companies have molds for shaping melted iron into any shape they want.\n7.	Sense is superior to money. We have don’t have enough respect for expertise in Nigeria. Indeed, human capital is the best capital; not finance.\n\nTODOs\n1.	Get the % of power being generated from coal in US, Germany and China.\n',12,'2018-06-14','17:43:48'),(96,'strategical wise warrants for only inventoried items is good.   ',10,'2018-06-14','18:29:01'),(97,'strategical wise warrants for only inventoried items is good.   ',10,'2018-06-14','18:29:12'),(98,'Good Job Alex',14,'2018-06-21','17:48:40'),(99,'Are you finished with this?',14,'2018-06-21','18:17:51'),(100,'Has this been done?',14,'2018-06-21','18:30:29'),(101,'Waiting for your reply',14,'2018-06-21','18:33:42'),(102,'Nicely Done!',14,'2018-06-21','18:38:20'),(103,'Clifford isn\'t here anymore is he?',14,'2018-07-05','17:24:04'),(104,'Who\'s taking this up please? We need to be on top of these issues as much as we can. There is no excuse for one of our precious tasks to be left unattended at any time.\n\n Heads will roll!!!',14,'2018-07-05','17:33:02'),(105,'Working on this one for a long time',14,'2018-07-06','07:02:51'),(106,'Well, this works... i hope!',14,'2018-07-06','14:30:53'),(107,'Trying again...',14,'2018-07-06','14:32:28'),(108,'Third time\'s the charm i hope!',14,'2018-07-06','14:33:52'),(109,'Working but just some finetuning needed',14,'2018-07-06','14:34:52'),(110,'Checking the replies...',14,'2018-07-06','14:35:19'),(111,'Take 2 for replies',14,'2018-07-06','14:37:34'),(112,'And a nested one just to be sure...',14,'2018-07-06','14:37:51'),(113,'Well, let\'s see how this goes',14,'2018-07-06','14:38:17'),(114,'Final Test here!',14,'2018-07-06','14:39:54'),(117,'I mistakenly deleted my former task (re-arranging my videos, music, images, etc and putting each of them in their separate folders on my PC and in drop box).\nI also did not log my breaks.(toilet break and breakfast). An oversight.',7,'2018-07-11','13:01:09'),(118,' @jnl7 We did spend more than 2 hours but we have pretty much covered the p doc outline now. We need to get further inputs from the Sec Gen before delving into the writing proper.  ',11,'2018-07-11','13:20:27'),(119,'I quoted a journal entry in the above comment. \"@jn17\" apparently references that journal entry but it isn\'t hyperlinked to the journal entry. This means that if there are 100 journal entries and quote one of them, it will be hard for people reading my comment to know which journal entry I\'m referring to.',11,'2018-07-11','13:23:27'),(120,'I\'m moving my user experience notes from my PC into the Books on the WRITE app that were created for documenting all of our software user experiences.',11,'2018-07-11','13:35:00'),(121,' @jnl10 The non availability of money at the point of trade constitute today\'s trade barrier. ',10,'2018-07-12','12:00:06'),(122,'Some small assignments given to Seun on these. Redo the Fashola bit. Put hyperlinks for both that and the one on metering.',14,'2018-07-12','18:12:24'),(123,'For this use case nothing was written in the main process flow.\nOnly the branch for challenges has something written in it.',10,'2018-07-16','13:20:49'),(124,'Today\'s article is \"Donald Trump insists on trade reciprocity. But what kind? \"',10,'2018-07-16','14:05:48'),(125,' @jnl18 \'article\'',8,'2018-07-16','19:51:36'),(126,'This is to broaden my knowledge on more power point effects as was stipulated by daddy during the process, documentation and multimedia team meeting on the 16th of July, 2018.',7,'2018-07-17','10:14:56'),(127,'I created a sub-task for this task but I can\'t find it.',11,'2018-07-17','11:58:57'),(128,'Stephen\nThe two row journal is perfect coo-coo.\nMale it at least 5... At the prior to posting point ... Same with this 3 line comments box ... ojare',14,'2018-07-17','14:24:35'),(129,'Since comments are for the attention of others and are for collaboration etc, we need a button that says VIEW ALL COMMENTS ....',14,'2018-07-17','16:23:37'),(130,'Since comments are to be acted upon, they must have a status, like OPEN, CLOSED, RE-OPENED, DUE, ASSIGNED, ETC',14,'2018-07-17','16:25:01'),(131,'I just noticed that this task is bound to it\'s creation date.. Such that I can have another instance of it on many other days ... Hope these can all be aggregate