insert  into `journal`(`id`,`text`,`sender_id`,`date`,`time`) values (6,'Time manager jusy got better. ',8,'2018-07-10','13:23:01'),(1,'Seun. 4 use cases. 9 to 12. ASSIGNMENT One only has a diagram. Choose any of the other 3 and do a diagram for it that can enter our p doc',14,'2018-07-05','21:27:23'),(2,'Seun. 4 use cases. 9 to 12. ASSIGNMENT One only has a diagram. Choose any of the other 3 and do a diagram for it that can enter our p doc',14,'2018-07-06','06:09:00'),(3,'Akachi Video. Bible in 3 minutes. Effect. Bible flipping of pages. Does Ini\'s Prezi only do pan and zoom and nothing else? Animatron for lion and snake animation ... Dont go overboard about quality of drawing. Just demonstrate the animation. Show us today.',14,'2018-07-06','06:21:07'),(4,'Why is our static ip bumping out? The NigDevFoundation modem is the old MTN. Perhaps it owns our static ip because the Netgear broadcasts only. We should adopt its own ip and reset everything .... How does this affect the fact that even the NDFWLAN is supposed to bring in internet for broadcasting ... We didn\'t let that happen because that would lead to hugging too much bandwidth .... Some troubleshooting reqd a la Stephen... At his own time ... Maybe Friday night ... First check many of our assumptions ... ',14,'2018-07-06','14:39:09'),(5,'Use case 12: Combined cash and warrants STC: This model offers the option of both cash and warrants to producers by syndicated traders.',14,'2018-07-06','15:57:06'),(7,'We are supposed to spend 2 hours together to map out an outline for the P. doc.',11,'2018-07-11','13:18:49'),(8,'This contains data from National Bureau of Statistics, World Fact Book and other reputable documentations on the extent of poverty in Nigeria.\nIt also takes a look at statistics of sectorial failure in the extant system.',8,'2018-07-12','10:19:46'),(9,'More of researching',10,'2018-07-12','10:30:20'),(10,'The number one difference between money and market warrant is that market warrant is always available unlike money ',10,'2018-07-12','11:57:29'),(11,'Read up preparatory to writing ... Should I be working on Abiola\'s latest version ... Yes. So, switching over ...',14,'2018-07-12','16:17:04'),(12,'Bimbo of Renmoney. Matter resolved.\nSito re the police case.\nTayo Fasan, back from Houston ...\n',14,'2018-07-12','17:27:24'),(13,'The Abiola updated version ...',14,'2018-07-12','17:35:44'),(14,'Seun on fashola',14,'2018-07-12','17:40:32'),(15,'Seun on Metering of electricity. Study and report.\n',14,'2018-07-12','18:01:31'),(16,'m to john momeh\ntr to stephen\n',14,'2018-07-13','17:20:37'),(17,'Stephen\nJohn Momeh\n',14,'2018-07-13','17:28:34'),(18,'Assigned to read an articlee form the Economist magazine weekly.\n',8,'2018-07-16','19:50:02'),(19,'I have done the UI specs for reporting time logs for tasks and sub-tasks.',11,'2018-07-17','11:57:00'),(20,'A sub-task of this task that I am working on now is the Time Plan and Task Tracking interface...',11,'2018-07-17','11:59:39'),(21,'Tolu on Services ... What\'s done, what\'s left ... May have to overhaul our messaging platform to embed order objects ... Designed the UX with Paint ... Trying to seal up what may be difficult for others to do in his absence ...',14,'2018-07-17','14:23:14'),(22,'Study use case 02, 05, 08 and 11',15,'2018-07-17','15:01:17'),(23,'GoDaddy domain renewal. Expired Visa card, replaced with UBA Mastercard 8414 Exo 02/21. Done by Emma. $90 for the WM.org and .com incl Privacy of domain at $20.',14,'2018-07-17','15:36:36'),(24,'What\'s up with Emma and Abiola ...\nEmma thinks only 10% of the Evernote CLAIMS have already been captured ...\nTrying to tabulate them ojare',14,'2018-07-17','15:48:10'),(25,'Completed an Excel sheet for the comparison of claims across the times. Saved on the local drive. Named Claims 2018 comparison grid for Emma.',14,'2018-07-17','16:16:33'),(26,'I  typing a new task.\nI am on the second row.\nhere is the third ',14,'2018-07-17','16:27:49'),(27,'Abiola still on his documentation of what we\'ve recently agreed ....',14,'2018-07-17','16:53:27'),(28,'Formalizing the algorithm for eligibility criteria. When more 2 or more persons are prepaying for the same item and none of them has completed the full payment, how do we rank the intending buyers?',11,'2018-07-17','18:43:31'),(29,'This use Case talks about how the WealthMarket can use her technology to facilitate the development of the country through massive investment in social infrastructure without depending on the government, borrowing or prior saving.',8,'2018-07-18','10:14:23'),(30,'We\'ve gone through creating a new task. Going through task features now',17,'2018-07-18','12:41:51'),(31,'The definition of Alternative Dispute Resolution refers to all the ways and methods of resolving disputes outside of the traditional or formal judicial process or litigation.',17,'2018-07-18','13:28:38'),(32,'I\'ve gone through the definition of Alternative Dispute Resolution. Going through the types of Alternative Dispute Resolution now.',17,'2018-07-18','13:31:04'),(33,'',17,'2018-07-18','13:31:08'),(34,'Went through Warrants 2 Way, Evernote and P. Doc 2008 to see what we have said about Market Concessioning. ',11,'2018-07-18','16:34:57'),(35,'I have now created a new Mindjet for comprehensively documenting our Market Concessioning Framework.\n',11,'2018-07-18','16:35:54'),(36,'I\'m presently going through how institutions can practice Alternative Dispute Resolution.',17,'2018-07-19','12:29:59'),(37,'Illustrating Use case 14(Channeling (quarantining ) of purchasing power from several account to few accounts.',15,'2018-07-20','09:02:53'),(38,'This assignment covers a very important topic in that the WM deals with a lot of people who are not \'bankable\'\n. Our aim is to see how we can navigate the Nigerian systemic failure to be able to provide solution which would radically transform the trajectory of the Nigerian e-transactions with the speed, eficiency and precision that make mobile money have an edge over manual transactions.',8,'2018-07-20','09:49:13'),(39,'This is a sub-task of the task...Going Public.\nThis fact is not obvious from the task details. It reflects on the task card though.',11,'2018-07-24','09:09:19'),(40,'I have added sub-tasks to this but I cannot see them in the task details. This makes it very difficult to use the Team Manager app, as it is, to manage our Going Public Project. For this to be useful, we need a UI to manage tasks and sub-tasks such that we are able to define relationships (or linkages) between them. Peer. Offspring. Parent etc. For example, some tasks are dependent on other tasks. Independent tasks can be done concurrently, but a dependent tasks can only be done after the tasks (or event) they depend on have been done (or has occurred).',11,'2018-07-24','09:46:09'),(41,'A short cut solution could be to use our links app to specify the relationships and be able to see a report through which a manager can see how the different aspects of the project is progressing. Full access to the links and reporting functionalities on this app would help us work out a framework we can use to manage our project using this app.',11,'2018-07-24','09:49:07'),(42,'The WealthMarket\'s major objective is to make football attractive to the extent that playaers from outside the country would be willing to come into Nigeria and play. This could be achieved by the use of WM technology to fund this process.',8,'2018-07-24','14:50:03'),(43,'Study Use case 20: BIWO',15,'2018-07-26','13:39:11'),(44,'Illustrating Use Case 20',15,'2018-07-27','09:52:30'),(45,'Working on Use case 30: Financing desirable but not commercially viable production e.g. solar energy, desalination / water supply.',15,'2018-08-01','10:44:35'),(46,'To Study Use case 24:  Sub-allocation of aggregate reflation need to onlending franchisees.',15,'2018-08-06','10:04:52'),(47,'As a result of high demand for tertiary education in Nigeria, for which government capacity is ubnable to cater, the WM has, as part of its mandate of Human and National Development, has decided to intervene by building world class universities which will cater for the education need of almost 1.5 million aplicants who seek admision into tertiary institutions yearly in Nigeria. This would forestall excessive education touriosm abroad as well as checkmate capital flight, and create jobs for millions of Nigerians.',8,'2018-08-06','11:53:25'),(48,'In order to solve the problem of producers being ladened with their unsold goods as a result of deficient comsumer purchasing power, the WM has decided to license and empower a group of traders known as the Syndicated Traders Chain by giving them fivefold reflation on their trading capital to enable them buy up all inventories on behalf of the WM.',8,'2018-08-06','16:05:02'),(49,'Emma Abiola and I. Sundry matters. ',14,'2018-08-06','17:35:59'),(50,'The meeting typically reviews the day\'s job and we brainstorm on other relevant topics.',8,'2018-08-06','18:08:22'),(51,'Mayowa to get buyable or free Blender images or animation... Blender is so powerful. ',14,'2018-08-06','19:12:32'),(52,'This Use Case is marked Dead.',8,'2018-08-07','11:00:50'),(53,'',8,'2018-08-07','11:00:53'),(54,'',8,'2018-08-07','11:00:58'),(55,'Use Case 53: Collecting all or parts of your salary in Warrants',15,'2018-08-07','12:58:23'),(56,'Tolu\'s services to goods interface ...',14,'2018-08-08','16:25:44'),(57,'*doing* I meant to type.',8,'2018-08-09','09:57:38');

